export class Calculator extends React.Component{
    render(){
        return(
            <div>
                <div className={'row'}>
                    <button className={'ui button'}>C</button>
                    <button className={'ui button'}>+/-</button>
                    <button className={'ui button'}>%</button>
                    <button className={'ui button'}>+</button>
                </div>
            </div>
        );
    }
}
